import React from 'react'
import './styles/NavigationBar.css'

export default function NavigationBar() {
  return (
    <div className='TopNavigationLayout'>
        <ActualNavigationBar/>
        <SearchBar/>
    </div>
  )
}

function ActualNavigationBar(){
    return (
        <div className='NavigationBarLayout'>
            <button className='NavigationBarExploreButton'>
                Explore
            </button>

            <button className='NavigationBarMyWheelsButton'>
                My Wheels
            </button>

            <button className='NavigationBarProfileButton'>
                Profile
            </button>
        </div>
    )
}

function SearchBar()
{
    return(
        <div className='SearchBarLayout'>
            <input type='text' placeholder='Search'></input>
            <button>Search</button>
        </div>
    )
}
